import { Link } from "react-router-dom";
import Login from "./Login";
import { useState } from "react";
import { Navigate } from "react-router-dom";


const Signup = () => {
    const [formVal, setFormVal] = useState({
        email: "",
        password: ""
    }
    );

    const handleChange = (event) => {
        const {name, value, type} = event.target
        setFormVal(e => {
           return {
            ...e,
            [name]: value
           } 
        })
    }
    const handleSumbit = (event) => {
        event.preventDefault();
        <Navigate to = "index"/>
    }
    return (
        <main>
            <div className="background"></div>
            <h3>Sign Up</h3>
            <form className="Sign-in" onSubmit={handleSumbit}>
                <label>
                    Email
                    <input for="username" type = "text" placeholder = "Email" id = "username" onChange={handleChange} value = {formVal.email}/>
                </label>
                <label>
                    Password
                    <input for = "password" type = "text" placeholder="Password" id = "password" onChange={handleChange} value = {formVal.password}/>
                </label>
                <button type = "submit">Log In</button>
                <div class="social">
                    <div class="go"><i class="fab fa-google"></i>  Google</div>
                </div>
            </form>
            <Link to = "/login" className="login-link">Already have a account? Click here to Login</Link>

        </main>
    )
}

export default Signup;
